import React from 'react';

export default function Box() {
  return (
    <div className='box'>
      <h1>You</h1>
      <img
        className='item-img'
        src='https://opengameart.org/sites/default/files/forum-attachments/very%20simple%20rock_0.png'
      />
      <h2>Win</h2>
    </div>
  );
}
